Notes:
This show featured the debut of Ass Handed. The Old Home Place was played for the first time since 6/28/12 (155 shows). NMINML contained C&amp;P quotes. Stash contained a What's the Use? tease. Ghost contained C&amp;P and What's the Use? teases, and NMINML quotes. Ghost also featured Trey on Marimba Lumina, and Mike and Page on percussion. CDT contained yet more NMINML, C&amp;P, and WTU? teases. 2001 contained C&amp;P quotes and NMINML teases. Cavern contained C&amp;P quotes and a WTU? tease. The Makisupa keyword was &quot;pot.&quot;
